import React from 'react'

function NavItem(props) {
  return(
    <li><a href="#" className="nav-item">{props.title}</a></li>
  )
}


export let NavBar = (props) => {
    return(
        <nav className="mx-auto pl-auto bg-blue-900">
          <div className="flex justify-end pt-5">
            <ul className='flex p-2'>
                <li className='px-2 pb-1 text-white'><a className="pb-2 px-2 hover:border-b-4 border-white ease-linear duration-150" href="#">Home</a></li>
                <li className='px-2 pb-1 text-white'><a className="pb-2 px-2 hover:border-b-4 border-white ease-out duration-150" href="#">Projects</a></li>
                <li className='px-2 pb-1 text-white'><a className="pb-2 px-2 hover:border-b-4 border-white ease-out duration-150" href="#">About</a></li>
                <li className='px-2 pb-1 text-white'><a className="pb-2 px-2 hover:border-b-4 border-white ease-out duration-150" href="#">Contact</a></li>
              </ul>
          </div>
        </nav>
    )
}
